function scrollToPosition(top, speed, callback){
	speed = speed||800;
	if( typeof callback != 'function' ) callback = function(){};

	$(documentBody).animate({
		scrollTop: top
	}, {
		duration: speed,
		complete: callback,
		easing: 'easeInOutCubic'
	});
	
	$(documentBody).on('mousewheel.stop', function(event) {
	    $(documentBody).stop();
	    $(documentBody).off('mousewheel.stop');
	});

	$(documentBody).promise().done(function() {
	    $(documentBody).off('mousewheel.stop');
	});
}


